    const goals = savedGoal.map((goal) =>
      <div>{goal.name}
        <input type="Text"></input>  <button type="button"> delete</button>
      </div>
    );
  return (
    <div className="manageGoals">
        input ur goals
        {goals}

        <div>
        <Link to= "/Settings">back</Link>
        </div>
    </div>
  );
}

export default manageGoals;
